import React from "react"
import './App.css';
import './Header.css';
import TinderCards from "./TinderCards";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"

function App() {
  return (
    <div className="App">
      <Header>
        <Router>
          <Switch>
            <Route path="/chat">
              <h1> I'm chat </h1>
            </Route>
            <Route path="/">
              <TinderCards />
            </Route>
          </Switch>
        </Router>
      </Header>
    </div>
  );
}
/*Tinder Cards*/
/*Buttons below Cards*/
export default App;
